create table PROFILE (
	profile_id          INT PRIMARY KEY,
	profile_firstname   VARCHAR(50),
	profile_lastname    VARCHAR(50),
	profile_email       VARCHAR(50),
	profile_ssn         VARCHAR(50),
	profile_image       CLOB,
	profile_dept        VARCHAR(50)
);
CREATE INDEX profile_dept_idx ON PROFILE(profile_dept);
CREATE INDEX profile_ssn_idx ON PROFILE(profile_ssn);
CREATE INDEX profile_lastname_idx ON PROFILE(profile_lastname);

